	add("staccato", "{\"term\":\"staccato\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"old norse\", \"old saxon\"], \"text\":\"{{borrowing|it|lang\u003den}} {{m|it|staccato||detached, disconnected}}, past participle of {{m|it|staccare||to detach, separate}}, aphetic variant of {{m|it|distaccare||to separate, detach}} from Middle french (ca. 1400-1600) {{m|frm|destacher||to detach}} from Old french (842-ca. 1400) {{m|fro|destachier||to detach}} from {{prefix|des|atachier|t2\u003dto attach|lang\u003dfro|nocat\u003d1}}, alteration of {{m|fro|estachier||to fasten with or to a stake, lay claim to}} from {{m|fro|estache||a stake}}, from Low Frankish {{m|frk|*stakka||stake}}, from Proto-germanic {{m|gem-pro|*stakkaz}}, {{m|gem-pro|*stakkēn||stick, stake}}, from Proto-indo-european {{m|ine-pro|*(s)teg-||stick, stake}}. Akin to Old high german (ca. 750-1050) {{m|goh|stecko||post}} (German {{m|de|Stecken||stick}}), Old saxon {{m|osx|stekko||stake}}, Old norse {{m|non|stakkr||hay stack, heap}}, Old english (ca. 450-1100) {{m|ang|staca||stake}}. More at {{l|en|stake}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An articulation marking directing that a note or passage of notes are to be played in an abruptly disconnected manner, with each note sounding for a very short duration, and a short break lasting until the sounding of the next note; as opposed to legato. Staccato is indicated by a dot directly above or below the notehead\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A passage having this mark\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stache", "{\"term\":\"stache\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{clipping|moustache|nodot\u003d1|lang\u003den}} or {{m|en|mustache}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Moustache, mustache\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027\u0027, [http://www.nytimes.com/2003/07/28/arts/television/28TEEN.html \u0026quot;Don\u0027t Wanna Grow Up Cuz Puberty Isn\u0027t Funny\u0026quot;], July 28, 2003\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Only one show has succeeded in keeping a kid in the lead for a decade: \u0026quot;The Simpsons\u0026quot; with the animated Bart Simpson. Watching Bart never mature is considered a key to its enduring appeal. \u0026quot;Early on, I know that the powers that be decided that no one would age,\u0026quot; said Tim Long, the show\u0027s current head writer. \u0026quot;A kid with a starter \u0027\u0027‘stache\u0027\u0027, that would just be unpleasant,\u0026quot; he added\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, \u0027\u0027, [http://www.nytimes.com/2005/05/23/nyregion/metrocampaigns/23campaign.html \u0026quot;Democrats Still Searching for a Stronger Challenger\u0026quot;], May 23, 2005\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The candidate] may face an entirely different challenge in his quest for the mayoralty: his mustache. [...] The perils of the \u0027\u0027‘stache\u0027\u0027 may be hard to define, but analysts say that looks matter in politics, where facial hair is frequently considered verboten\", \"priority\":5}]}, \"synonyms\":{}}");

