	add("staddle", "{\"term\":\"staddle\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"middle low german\", \"Icelandic\"], \"text\":\"From Middle english (1100-1500) \u0027stathel\u0027 from Old english (ca. 450-1100) \u0027staþol\u0027 (foundation, base, support, position, site, estate) from Proto-germanic {{m|gem-pro|*staþulaz||position, standing}}, from Proto-indo-european {{m|ine-pro|*steh₂-}}, {{m|ine-pro|*sth₂-||to stand}}. Cognate with Middle low german \u0027stadel\u0027 (barn) German \u0027stadel\u0027 (ground, croft, stall, shed) Old Danish \u0027stedel\u0027 (ground, croft) Icelandic \u0027stöðull\u0027 (position) More at {{l|en|stand}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A prop or support; a staff, crutch\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The lower part or supporting frame of a stack, a stack-stand\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any supporting framework or base\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A small tree; sapling\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One of the separate plots into which a coc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"cock of hay is shaken out for the purpose of drying\", \"priority\":6}]}, \"synonyms\":{}}");

