	add("stage", "{\"term\":\"stage\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"{{PIE root|en|steh₂}}From Middle english (1100-1500) {{m|enm|stage}}, from Old french (842-ca. 1400) \u0027estage\u0027 (lang\u003dfro) from \u0027*stāticum\u0027 (standing-place) from Latin {{m|la|stāre||to stand}}. Cognate with Old english (ca. 450-1100) {{m|ang|stæde}}, \u0027stede\u0027 (state, status, standing, place) More at {{l|en|stead}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A phase\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1800-1859\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Such a polity is suited only to a particular \u0027\u0027stage\u0027\u0027 in the progress of society\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d3|page\u003d21|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/joris-luyendijk-banking-blog/2013/jun/19/banking-britain-beyond-control Our banks are out of passage\u003dSeeing the British establishment struggle with the financial sector is like watching an alcoholic\u0026amp;nbsp;[\u0026amp;hellip;].\u0026amp;nbsp; Until 2008 there was denial over what finance had become.\u0026amp;nbsp;[\u0026amp;hellip;]\u0026amp;nbsp; But the scandals kept coming, and so we entered \u0027\u0027stage\u0027\u0027 three – what therapists call \u0026quot;bargaining\u0026quot;. A broad section of the political class now recognises the need for change but remains unable to see the necessity of a fundamental overhaul. Instead it offers fixes and patches\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A platform, generally elevated, upon which show performances or other public events are given\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1688-1744\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Knights, squires, and steeds must enter on the \u0027\u0027stage\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1791–1875\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Lo! Where the \u0027\u0027stage\u0027\u0027, the poor, degraded stage, / Holds its warped mirror to a gaping age\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A floor or storey of a house\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A floor elevated for the convenience of mechanical work, etc.; scaffolding; staging\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A platform, often floating, serving as a kind of wharf\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A stagecoach, an enclosed horsedrawn carriage used to carry passengers\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1731-1800\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"a parcel sent you by the \u0027\u0027stage\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1667–1745\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"I went in the sixpenny \u0027\u0027stage\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A place of rest on a regularly travelled road; a station; a place appointed for a relay of horses\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A degree of advancement in a journey; one of several portions into which a road or course is marked off; the distance between two places of rest on a road\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Jeffre\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027stage\u0027\u0027 signifies a certain distance on a road\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"1858\u0027\u0027, , \u0027[http://books.google.com.au/books?id\u003dPKOV67lbNMAC The Life of George Stephenson: Railway Engineer]\u0027, p.35\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"He travelled by gig, with his wife, his favourite horse performing the journey by easy \u0027\u0027stages\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.gutenberg.org/ebooks/11593 The Purchase chapter\u003d3|passage\u003dThe \u0027Mount Vernon\u0027, favoured by a good stage of water, soon cleared the narrow Monongahela channel, passed the confluence, and headed down under full steam,\u0026amp;nbsp;[\u0026amp;hellip\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"The number of an electronic circuit’s block, such as a filter, an amplifier, etc\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"The place on a microscope where the slide is located for viewing\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"A level; one of the sequential areas making up the game\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"A place where anything is publicly exhibited, or a remarkable affair occurs; the scene\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"When we are born, we cry that we are come / To this \u0027\u0027stage\u0027\u0027 of fools\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"1608-1674\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"Music and ethereal mirth / Wherewith the \u0027\u0027stage\u0027\u0027 of air and earth did ring\", \"priority\":32}]}, \"synonyms\":{}}");

	add("stagehand", "{\"term\":\"stagehand\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stage|hand|tr2\u003dmanual worker|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who works behind the scenes at a theatre or in other theatrical media\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The actors get the glory, the spotlight and the name up in lights while it is the \u0027\u0027stagehands\u0027\u0027 who point the spotlight, hang the name and change the light bulbs\", \"priority\":2}]}, \"synonyms\":{}}");

