	add("staircase", "{\"term\":\"staircase\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"stair + case\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flight of stairs; a stairway\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A connected set of flights of stairs; a stairwell\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Turning back, then, toward the basement \u0027\u0027staircase\u0027\u0027, she began to grope her way through blinding darkness, but had taken only a few uncertain steps when, of a sudden, she stopped short and for a little stood like a stricken thing, quite motionless save that she quaked to her very marrow in the grasp of a great and enervating fear\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d19|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dWhen Timothy and Julia hurried up the \u0027\u0027staircase\u0027\u0027 to the bedroom floor, where a considerable commotion was taking place, Tim took Barry Leach with him. He had him gripped firmly by the arm, since he felt it was not safe to let him loose, and he had no immediate idea what to do with him\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A set of locks (enclosed sections of waterway) mounted one above the next\", \"priority\":5}]}, \"synonyms\":{}}");

	add("stairfoot", "{\"term\":\"stairfoot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stair|foot|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The foot, or bottom, of a flight of stairs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He blew out the lamp, and closed the \u0027\u0027stairfoot\u0027\u0027 door after him, as he slowly mounted the stairs behind her\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stairlift", "{\"term\":\"stairlift\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stair|lift|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A motorized platform installed in a stairway, which traverses the stairs when activated, for the benefit of those for whom the stairs are a barrier\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stairway", "{\"term\":\"stairway\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A set of steps allowing one to walk up or down comfortably\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d5|passage\u003dThen came a maid with hand-bag and shawls, and after her a tall young lady. She stood for a moment holding her skirt above the grimy steps, with something of the stately pose which Richter has given his Queen Louise on the \u0027\u0027stairway\", \"priority\":2}]}, \"synonyms\":{}}");

	add("staithe", "{\"term\":\"staithe\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"old norse\"], \"text\":\"From Old english (ca. 450-1100) \u0027stæð\u0027 and/or Old norse \u0027stödh\u0027 (harbor)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A riverban\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fixed structure where ships land, especially to load and unload; wharf; landing stage\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stakes", "{\"term\":\"stakes\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The money wagered in gambling\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Risks\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stakhanovite", "{\"term\":\"stakhanovite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Stakhanov|ite|lang\u003den}}, from the name of w:Aleksei Grigorievich Stakhanov|Aleksei Grigor’evich Stakhanov (Алексе́й Григо́рьевич Стаха́нов), a Russian coal miner whose prodigious output was publicised by Stalin as part of a 1935 campaign.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An extremely productive or hard-working worker, especially in the former USSR, who may earn special rewards; a workaholic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, Lewis H. Siegelbaum, \u0027Stakhanovism and the Politics of Productivity in the USSR, 1935-1941\u0027, [http://books.google.com.au/books?id\u003dtFO2JAuI1WkC\u0026amp;pg\u003dPA183\u0026amp;dq\u003d%22Stakhanovites%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dmJ0tUd6gBqmPmQXP6oHQAw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Stakhanovites%22\u0026amp;f\u003dfalse page 183\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Nevertheless, few outstanding \u0027\u0027Stakhanovites\u0027\u0027 remained at the bench for very long. Even if they stayed on the enterprise payroll, they ceased to be workers, becoming instead living icons\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Stephan Merl, \u0027III: Social Mobility in the Countryside\u0027, William G. Rosenberg, Lewis H. Siegelbaum (editors), \u0027Social Dimensions of Soviet Industrialization\u0027, [http://books.google.com.au/books?id\u003dnbUJNOpfNn4C\u0026amp;pg\u003dPA56\u0026amp;dq\u003d%22Stakhanovites%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003do4QtUZvMLbCemQWm24GoAw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Stakhanovites%22\u0026amp;f\u003dfalse page 56\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Kolkhozniki were soon attacking the \u0027\u0027Stakhanovites\u0027\u0027 with abandon, beating them up, destroying their animals, even killing them.\u0026lt;sup\u0026gt;40\u0026lt;/sup\u0026gt; For obvious reasons, collective farm management and even village authorities were often also not eager to see labor norms increased and colluded in these attacks\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Stephen Kotkin, \u0027Magnetic Mountain: Stalinism As a Civilization\u0027, [http://books.google.com.au/books?id\u003dQg6pZ01Eu_8C\u0026amp;pg\u003dPA500\u0026amp;dq\u003d%22Stakhanovites%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003do4QtUZvMLbCemQWm24GoAw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Stakhanovites%22\u0026amp;f\u003dfalse page 500\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In mid-1936, the steel plant\u0027s deputy director, Khazanov, revealed that according to factory administration data there were 3,663 \u0027\u0027Stackhanovites\u0027\u0027 at the steel plant, but according to the records of the trade union committee, there were 4,441. “In our shops,” he commented, “there are insufficiently precise criteria for determining \u0027\u0027Stakhanovites\u0027\u0027.”\", \"priority\":10}]}, \"synonyms\":{}}");

	add("stalactite", "{\"term\":\"stalactite\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027stalactites\u0027 from Ancient greek (to 1453) \u0027σταλακτός\u0027 (dripping)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mineral deposit of calcium carbonate, in shapes similar to icicles, that hangs from the roof of a cave\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stalagmite", "{\"term\":\"stalagmite\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027stalagmites\u0027 from Ancient greek (to 1453) \u0027στάλαγμα\u0027 (drop) or \u0027σταλαγμός\u0027 (dripping)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mineral deposit of calcium carbonate, in shapes similar to icicles, that lie on the ground of a cave\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stallion", "{\"term\":\"stallion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Proto-Germanic\"], \"text\":\"From Middle english (1100-1500) \u0027stalion\u0027 from Middle french (ca. 1400-1600) \u0027estalon\u0027 (hence modern French {{m|fr|étalon}}), of Proto-germanic origin, akin to {{m|en|stall}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A male horse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Specifically, one that is uncastrated\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A male horse kept primarily as a stud\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A very virile, sexy or horny man\", \"priority\":4}]}, \"synonyms\":{}}");

	add("stamp", "{\"term\":\"stamp\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"Dutch\", \"Occitan\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027stampen\u0027 (to pound, crush) from assumed Old english (ca. 450-1100) {{m|ang|*stampian}}, variant of Old english (ca. 450-1100) \u0027stempan\u0027 (to crush, pound, pound in mortar, stamp) from Proto-germanic {{m|gem-pro|*stampijaną||to trample, beat}}, from Proto-indo-european {{m|ine-pro|*stemb-||to trample down}}. Cognate with Dutch \u0027stampen\u0027 (to stamp, pitch) German \u0027stampfen\u0027 (to stamp) Danish \u0027stampe\u0027 (to stamp) Swedish \u0027stampa\u0027 (to stomp) Occitan \u0027estampar\u0027 See also {{l|en|stomp}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Stamp US 1847 5c-Benjamin right|thumb|The first U.S. stam\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An act of stamping the foot, paw or hoof\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The horse gave two quick \u0027\u0027stamps\u0027\u0027 and rose up on its hind legs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Just then there was a sound of footsteps, and the Boy ran past near them, and with a \u0027\u0027stamp\u0027\u0027 of feet and a flash of white tails the two strange rabbits disappeared\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An indentation or imprint made by stamping\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"My passport has quite a collection of \u0027\u0027stamps\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A device for stamping designs\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"She loved to make designs with her collection of \u0027\u0027stamps\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A small piece of paper bearing a design on one side and adhesive on the other, used to decorate letters or craft work\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"These \u0027\u0027stamps\u0027\u0027 have a Christmas theme\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A small piece of paper, with a design and a face value, used to prepay postage postage or other costs such as tax or licence fees\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"I need one first-class \u0027\u0027stamp\u0027\u0027 to send this letter\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Now that commerce is done electronically, tax \u0027\u0027stamps\u0027\u0027 are no longer issued here\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A tatto\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A single dose of lysergic acid diethylamide\", \"priority\":15}]}, \"synonyms\":{}}");

	add("stamen", "{\"term\":\"stamen\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{PIE root|en|steh₂}}From Latin \u0027stamen\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In flowering plants, the structure in a flower that produces pollen, typically consisting of an anther and a filament\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stamper", "{\"term\":\"stamper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who stamps\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An instrument for pounding or stamping\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A physical template from which many identical compact discs can be produced\", \"priority\":3}]}, \"synonyms\":{}}");

	add("stance", "{\"term\":\"stance\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Italian\", \"Latin\"], \"text\":\"Via French from Italian \u0027stanza\u0027 (standing place) from Latin \u0027stāre\u0027 (to stand)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The manner, posture, or pose in which one stands\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The fencer’s \u0027\u0027stance\u0027\u0027 showed he was ready to begin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One’s opinion or point of view\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I don’t agree with your \u0027\u0027stance\u0027\u0027 on gun control\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A station; a position; a site; a stopping place for buses at a bus statio\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A stanza\", \"priority\":6}]}, \"synonyms\":{}}");

	add("stanchion", "{\"term\":\"stanchion\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old french (842-ca. 1400) \u0027estanson\u0027 \u0027estanchon\u0027 (Modern French \u0027étançon\u0027 , from \u0027estance\u0027 (a stay, a prop) from Latin \u0027stans\u0027 (standing) present participle of \u0027stō\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Stanchions and velvet rope - 37th G8 summit in Deauville thumb|Stanchions supporting velvet rop\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A vertical pole, post, or support\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, w:J. M. J. M. Coetzee, \u0027w:The Childhood of The Childhood of Jesus\u0027. Melbourne, Australia: The Text Publishing Company. chapter 27. p. 268\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He staggers against a \u0027\u0027stanchion\u0027\u0027, trips over a rope, and tumbles into the space between the quay and the steel plates of the freighter\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A framework of such posts, used to secure or confine cattle\", \"priority\":5}]}, \"synonyms\":{}}");

	add("standardista", "{\"term\":\"standardista\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|standard|ista|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A web developer who is actively involved in the creation, adoption, and/or promotion of web standards\", \"priority\":1}]}, \"synonyms\":{}}");

	add("standardization", "{\"term\":\"standardization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|standardize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of complying (or evaluate by comparing) with a standard\u0026lt;!-- , of adapting so all are similar--\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The process of establishing a standard\", \"priority\":2}]}, \"synonyms\":{}}");

	add("standby", "{\"term\":\"standby\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"State of readiness without being immediately involved\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The troops were on \u0027\u0027standby\u0027\u0027 in case of an attack\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Waiting at the airport in the hope of getting a seat on a flight that is already booked out\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Something that is standard, well-tested, or frequently used\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"That recipe is an old \u0027\u0027standby\u0027\u0027, and she keeps the ingredients around in case of unexpected guests\", \"priority\":5}]}, \"synonyms\":{}}");

	add("standee", "{\"term\":\"standee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|lang\u003den|stand|ee}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Somebody who is forced to stand, for example on a crowded bus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A life-size shape, for instance of a celebrity, cut out of cardboard, often used for advertising and promotional purposes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He took a picture of me with a \u0027\u0027standee\u0027\u0027 of Darth Vader at the premiere of Episode 3\", \"priority\":3}]}, \"synonyms\":{}}");

	add("standoff", "{\"term\":\"standoff\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stand|off|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device which maintains a fixed distance between two objects, especially between a surface and a sign or electrical wiring\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Wikipedia, \u0027:w:Insulator Insulator (electricity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Feedlines attaching antennas to radio equipment, particularly twin lead type, often must be kept at a distance from metal structures. The insulated supports used for this purpose are called \u0027\u0027standoff\u0027\u0027 insulators\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A deadlocked confrontation between antagonists (see stand off and\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"verb below\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I don\u0027t want to get involved in the \u0027\u0027standoff\u0027\u0027 between those two\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A tense \u0027\u0027standoff\u0027\u0027 between demonstrators and police continued overnight\", \"priority\":7}]}, \"synonyms\":{}}");

	add("standpoint", "{\"term\":\"standpoint\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"Japanese\"], \"text\":\"{{compound|stand|point|lang\u003den}}, a calque of German \u0027standpunkt\u0027 Similar constructions used in other languages, such as Japanese \u0027立場\u0027 meaning \u0027standing place\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"point of Point of view; perspectiv\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bathing once a month may save time, but from a cleanliness \u0027\u0027standpoint\u0027\u0027, it\u0027s not effective\", \"priority\":2}]}, \"synonyms\":{}}");

	add("staniel", "{\"term\":\"staniel\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027staniel\u0027 (bird of prey) from Old english (ca. 450-1100) {{m|ang|stānġiella||staniel, pelican\u0026quot;; literally, \u0026quot;rock-crier}}, from {{m|ang|stān||stone, rock}} + {{m|ang|ġiella||yeller, crier}}. More at {{l|en|stone}}, {{l|en|yell}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The kestrel or windhover\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stannylium", "{\"term\":\"stannylium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|stannyl|ium|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any cation formed by a tin atom with three bonds, having the general formula R\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;Sn\u0026lt;sup\u0026gt;+\u0026lt;/sup\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stanza", "{\"term\":\"stanza\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"From Italian \u0027stanza\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A unit of a poem, written or printed as a paragraph; equivalent to a verse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An apartment or division in a building.\u0026lt;!--Webster 1913--\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An XML element which acts as basic unit of meaning in XMPP\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, P. Saint-Andre, \u0027RFC 6120 - Extensible Messaging and Presence Protocol (XMPP): Core\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Definition of XML \u0027\u0027Stanza\u0027\u0027: An XML \u0027\u0027stanza\u0027\u0027 is the basic unit of meaning in XMPP\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Tim Riley, Adam Goucher, \u0027Beautiful Testing: Leading Professionals Reveal How They Improve Software\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Whenever an XMPP client generates an XML \u0027\u0027stanza\u0027\u0027, it typically constructs the XML of the stanza by building up a structured document\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, John Rittinghouse, James F. Ransome, \u0027Cloud Computing: Implementation, Management, and Security\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Technically speaking, federation is the ability for two XMPP servers in different domains to exchange XML \u0027\u0027stanzas\", \"priority\":9}]}, \"synonyms\":{}}");

	add("stapes", "{\"term\":\"stapes\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027stapēs\u0027 (stirrup)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small stirrup-shaped bone of the middle ear\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Elaine N. Marieb \u0026amp; Katja Hoehn, \u0027Human Anatomy \u0026amp; Physiology\u0027, 8th edition, page 57\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The tympanic cavity is spanned by the three smallest bones in the body: the auditory ossicles These bones, named for their shape, are the malleus (malʹe-us; \u0026quot;hammer\u0026quot;); the incus (ingʹkus; \u0026quot;anvil\u0026quot;); and the \u0027\u0027stapes\u0027\u0027 (staʹpēz; \u0026quot;stirrup\u0026quot;). The \u0026quot;handle\u0026quot; of the malleus is secured to the eardrum, and the base of the \u0027\u0027stapes\u0027\u0027 fits into the oval window\", \"priority\":3}]}, \"synonyms\":{}}");

	add("staphyloxanthin", "{\"term\":\"staphyloxanthin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|staphylo|xanthin|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A carotenoid pigment produced by some strains of \u0027Staphylococcus aureus\u0027, which acts as a virulence factor\", \"priority\":1}]}, \"synonyms\":{}}");

	add("starboard", "{\"term\":\"starboard\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"Middle english (1100-1500) \u0027sterbord\u0027 from Old english (ca. 450-1100) {{compound|stēor|bord|gloss1\u003dsteer|gloss2\u003dside (of a ship)|lang\u003dang|nocat\u003d1}}. Ships had to dock on their left (port) side because the steering oar on the right would get in the way, which is how the left became known as the port side.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The right hand side of a ship, boat or aircraft when facing the front, or fore or bow. Starboard does not change based on the orientation of the person aboard the craft\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One of the two traditional watches aboard a ship standing a watch in two\", \"priority\":2}]}, \"synonyms\":{}}");

	add("starburst", "{\"term\":\"starburst\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|star|burst|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A violent explosion, or the pattern (likened to the shape of a star) supposed to be made by such an explosion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027: Ellen Datlow, Terri Windling, \u0027The Year\u0027s Best Fantasy \u0026amp; Horror\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"his arm striking brick and the bottle shattering in a \u0027\u0027starburst\u0027\u0027 of black\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027: Tim Cockey, \u0027Murder in the Hearse Degree: A Novel\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027starburst\u0027\u0027 of red exploded on his chest and he flew backward a good six or seven feet\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027: Elizabeth George, \u0027Write Away: One Novelist\u0027s Approach to Fiction and the Writing Life\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"and another that creates a cicatrix \u0027\u0027starburst\u0027\u0027 from her right eye to her temple. This scar is the result of an accident when she was ten years old\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A symbol similar to an asterisk, but with additional rays: \u0026lt;font size\u003d6\u0026gt;✺\u0026lt;/font\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A region of space with an unusually high rate of star formation\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A period in time during which a region of space experiences an unusually high rate of star formation\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"the Milky Way will see a \u0027\u0027starburst\u0027\u0027 in approximately 200\u0026amp;nbsp;000\u0026amp;nbsp;000 years\", \"priority\":11}]}, \"synonyms\":{}}");

	add("staredown", "{\"term\":\"staredown\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stare|down|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A confrontation in which each party waits for the other to yiel\", \"priority\":1}]}, \"synonyms\":{}}");

	add("staree", "{\"term\":\"staree\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|stare|ee|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is stared at\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Jay Ingram, \u0027The Velocity of Honey and More Science of Everyday Life\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"So at first the starer sat right behind the \u0027\u0027staree\u0027\u0027; then the starer sat behind a one-way mirror, to eliminate the possibility of subtle sound clues created when the starer looked either at or away from the staree\", \"priority\":3}]}, \"synonyms\":{}}");

	add("starfish", "{\"term\":\"starfish\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"star + fish\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various asteroids or other echinoderms (not in fact fish) with usually five arms, many of which eat bivalves or corals by everting their stomach\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"an anus. See also chocolate starfish\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any many-armed or tentacled sea invertebrate, whether cnidarian, echinoderm, or cephalopod\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1755\u0027\u0027, w:Erik Erik Pontoppidan, trans. Isaac Kimbler, \u0027Explanation of the Plate of Uncommon Star Fish, Extracted from the Natural History of Norway\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"But the largest of the \u0027\u0027star-fish\u0027\u0027 kind is that sea monster called kruken, kraken or krabben. [...] As this enormous sea-animal in all probability may be reckoned of the polype, or of the \u0027\u0027star-fish\u0027\u0027, kind, it seems that the parts which are seen rising at its pleasure, and are called arms, are properly the tentacula, or feeding instruments, called horns as well as arms\", \"priority\":5}]}, \"synonyms\":{}}");

	add("starflower", "{\"term\":\"starflower\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|star|flower|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several annual herbs, of the genus , having white star-shaped leaves\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stargazer", "{\"term\":\"stargazer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|star|gazer|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who stargazes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A perciform fish in the family\", \"priority\":2}]}, \"synonyms\":{}}");

	add("starhood", "{\"term\":\"starhood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|star|hood|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being a star (whether an astronomic object or a celebrity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Tom Siegfried, \u0027Strange Matters: Undiscovered Ideas at the Frontiers of Space and Time\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Brown dwarfs are much bigger than planets but not quite big enough to generate the internal pressure needed to burst into \u0027\u0027starhood\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Mark Littmann, Fred Espenak and Ken Willcox, \u0027Totality: Eclipses of the Sun\u0027, page 28\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Near those stars-to-be, other bodies, too low in mass ever to reach \u0027\u0027starhood\u0027\u0027, also began to form\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Peter Benjaminson, \u0027The Lost Supreme: The Life of Dreamgirl Florence Ballard\u0027, page 16\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It was the only image of the funeral most people saw, making the occasion an emblem of Diana\u0027s \u0027\u0027starhood\u0027\u0027 rather than a celebration of Florence\u0027s life and a scene of mourning for her death\", \"priority\":7}]}, \"synonyms\":{}}");

	add("starkeyite", "{\"term\":\"starkeyite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Starkey|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monoclinic-prismatic white mineral containing hydrogen, magnesium, oxygen, and sulfur\", \"priority\":1}]}, \"synonyms\":{}}");

	add("starlet", "{\"term\":\"starlet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|star|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A young actress with a promising career ahead of her\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Christoper Zara, \u0027Tortured Artists: From Picasso and Monroe to Warhol and Winehouse, the Twisted Secrets of the World\u0027s Most Creative Minds\u0027, part 1, chapter 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There were other flapper-era \u0027\u0027starlets\u0027\u0027, of course—Louise Brooks, Greta Garbo—but they were poseurs by comparison\", \"priority\":3}]}, \"synonyms\":{}}");

	add("starlight", "{\"term\":\"starlight\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|star|light|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Light emitted from stars other than the Su\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Nor walk by moon, / Or glittering \u0027\u0027starlight\u0027\u0027, without thee is sweet\", \"priority\":3}]}, \"synonyms\":{}}");

	add("starnie", "{\"term\":\"starnie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|starn|ie|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small star\", \"priority\":1}]}, \"synonyms\":{}}");

	add("starquake", "{\"term\":\"starquake\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|star|earthquake|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A violent tremor or quake that occurs on or near the surface of a star, especially a collapsed star\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Paul Murdin, Lesley Murdin, \u0027New Astronomy\u0027, [http://books.google.com.au/books?id\u003d2zTnw4fR17YC\u0026amp;pg\u003dPA131\u0026amp;dq\u003d%22starquake%22%7C%22starquakes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003djNzOUdTUGMaKiQed84HIBg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22starquake%22%7C%22starquakes%22\u0026amp;f\u003dfalse page 131\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Astronomers call the sudden changes in the neutron star \u0027\u0027\u0027starquakes\u0027\u0027\u0027. The energy released in a \u0027\u0027starquake\u0027\u0027 is enormous and flows out from the star into the space surrounding it. After the 1969 \u0027\u0027starquake\u0027\u0027 on the Crab pulsar, a wave of energy was seen to flow outwards, rippling through the centre of the Crab Nebula\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Richard I. Epstein, Bennett Link, \u0027\u0027\u0027Starquake\u0027\u0027-Induced Glitches in Pulsars\u0027, Kwong-Sang Cheng H, F, Chau, K. L. Chan, K. C. Leung (editors), \u0027Stellar Astrophysics: Proceedings of the Pacific Rim Conference\u0027, [http://books.google.com.au/books?id\u003dWqBD5Yn89SgC\u0026amp;pg\u003dPA96\u0026amp;dq\u003d%22starquake%22%7C%22starquakes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003djNzOUdTUGMaKiQed84HIBg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22starquake%22%7C%22starquakes%22\u0026amp;f\u003dfalse page 96\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Starquakes\u0027\u0027 in slowing neutron stars drive matter toward the magnetic poles, distort the star\u0027s shape, and excite precession\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, w:Carl Carl Sagan, Jerome Agel, \u0027Carl Sagan\u0027s Cosmic Connection: An Extraterrestrial Perspective\u0027 [new edition of 1973, \u0027The Cosmic Connection\u0027], [http://books.google.com.au/books?id\u003dlL57o9YB0mAC\u0026amp;pg\u003dPA260\u0026amp;dq\u003d%22starquake%22%7C%22starquakes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003djNzOUdTUGMaKiQed84HIBg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22starquake%22%7C%22starquakes%22\u0026amp;f\u003dfalse page 260\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Should the core be solid, \u0027\u0027starquakes\u0027\u0027 are expected — a shifting of the matter under enormous stress in the interior of the star. Such \u0027\u0027starquakes\u0027\u0027 should produce a discontinuous change in the period of rotation of the neutron star. Such changes, called \u0026quot;glitches,\u0026quot; are observed\", \"priority\":10}]}, \"synonyms\":{}}");

	add("starshine", "{\"term\":\"starshine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|star|shine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"starligh\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Robert Louis Stevenso\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027starshine\u0027\u0027 lights upon our heads\", \"priority\":3}]}, \"synonyms\":{}}");

	add("startbox", "{\"term\":\"startbox\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|start|box|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The compartment of a maze etc. into which the animal subject in a psychology experiment is initially placed\", \"priority\":1}]}, \"synonyms\":{}}");

