	add("starvation", "{\"term\":\"starvation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{affix|en|starve|-ation}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a condition of severe suffering due to a lack of nutrition\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, w:The Land That Time Forgot The Land That Time Forgot Chapter I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;We haven\u0027t one chance for life in a hundred thousand if we don\u0027t find food and water upon Caprona. This water coming out of the cliff is not salt; but neither is it fit to drink, though each of us has drunk. It is fair to assume that inland the river is fed by pure streams, that there are fruits and herbs and game. Shall we lie out here and die of thirst and \u0027\u0027starvation\u0027\u0027 with a land of plenty possibly only a few hundred yards away? We have the means for navigating a subterranean river. Are we too cowardly to utilize this means?\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("starveling", "{\"term\":\"starveling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|starve|ling|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is thin from lack of food\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1597\u0027\u0027, w:William William Shakespeare, \u0027Henry IV Part I\u0027, act 2, sc. 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If I hang, I\u0027ll make a fat pair of gallows; for if I hang, old Sir John hangs with me, and thou knowest he is no \u0027\u0027starveling\", \"priority\":3}]}, \"synonyms\":{}}");

	add("starwort", "{\"term\":\"starwort\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|star|wort|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several unrelated plants that have a star-shaped flowers or leaves, but especially members of the genus \u0027Stellaria\", \"priority\":1}]}, \"synonyms\":{}}");

