	add("stats", "{\"term\":\"stats\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short form of \u0027\u0027statistics\u0027\u0027 (\u0027the subject\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Stats\u0027\u0027 is one of her favourite subjects at school\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A short form of \u0027\u0027statistics\u0027\u0027 (\u0027data, figures\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"What do the \u0027\u0027stats\u0027\u0027 tell us\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Attributes of a unit in a video game (e.g. health, damage output\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Those items he bought really boosted his \u0027\u0027stats\", \"priority\":6}]}, \"synonyms\":{}}");

