	add("statesman", "{\"term\":\"statesman\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"Calque of French \u0027lang\u003dfr\u0027 \u0027state\u0027 {suffix||man|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man who is a leader in national or international affairs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A male political leader who promotes the public good or who is recognized for probity, leadership, or the qualities necessary to govern a state\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the dialect of the English wikipedia:Lake Lake District and nearby, a man who lives on a landed estate\u0026lt;!--(ref. several uses in [http://tera-3.ul.cs.cmu.edu/NASD/d23d381a-642a-4cb1-bd42-5373f518ed1d/lemur/974.sgml this link])--\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

