	add("statua", "{\"term\":\"statua\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027statua\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A statue\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"III.2.1.i\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"whilst he played, he put his ring upon the finger of Venus\u0027 \u0027\u0027statua\u0027\u0027, which was thereby, made in brass\u0026amp;nbsp;[…\", \"priority\":3}]}, \"synonyms\":{}}");

