	add("stature", "{\"term\":\"stature\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027stature\u0027 from Latin \u0027statūra\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person or animal\u0027s natural height when standing upright\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Respect coming from achievement or development\", \"priority\":2}]}, \"synonyms\":{}}");

	add("statute", "{\"term\":\"statute\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027status\u0027 from Old french (842-ca. 1400) \u0027statut\u0027 from \u0027statutum\u0027 (a statute) neuter singular of Latin \u0027statutus\u0027 past participle of \u0027statuō\u0027 (i set up, establish)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Written law, as laid down by the legislature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Common law) Legislated rule of society which has been given the force of law by those it governs\", \"priority\":2}]}, \"synonyms\":{}}");

