	add("stave", "{\"term\":\"stave\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{back-form|staves|nodot\u003d9|lang\u003den}}, the plural of \u0027staff\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of a number of narrow strips of wood, or narrow iron plates, placed edge to edge to form the sides, covering, or lining of a vessel or structure; especially, one of the strips which form the sides of a cask, a pail, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One of the bars or rounds of a rack, rungs of a ladder, etc; one of the cylindrical bars of a lantern whee\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A metrical portion; a stanza; a staff\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Wordswort\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Let us chant a passing \u0027\u0027stave\u0027\u0027 / In honour of that hero brave\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The five horizontal and parallel lines on and between which musical notes are written or pointed; the staff\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A staff or walking stick\", \"priority\":7}]}, \"synonyms\":{}}");

